import React, { useState } from "react";


function Main() {
    const [color,setColor] = useState("red")
    
    const handelColor = function(){
        setColor("green");
    }

    return(
    <>
     <p> color state is: <span style={{color:color}}> {color} </span></p>
     <button type="button" onClick={handelColor}> BUTTON </button>
    </>
    )
}

export default Main;
